import { join } from 'path';
import { defineConfig } from 'umi';
import { createHash } from 'crypto';

export default defineConfig({
  chainWebpack(config, { env }) {
    if (env === 'production') {
      config.cache({
        type: 'filesystem',
        store: 'pack',
        // \u{1F7E1} \u5047\u5982\u4F60\u7684\u9879\u76EE\u5728 CI \u4E2D\u6784\u5EFA\u6BCF\u6B21\u73AF\u5883\u53D8\u91CF\u90FD\u4E0D\u4E00\u6837\uFF0C\u8BF7\u6311\u9009\u6216\u8005\u6392\u9664
        version: createEnvironmentHash(process.env),
        buildDependencies: {
          config: [__filename],
          tsconfig: [join(__dirname, 'tsconfig.json')],
          packagejson: [join(__dirname, 'package.json')],
          umirc: [join(__dirname, '.umirc.ts')],
          // \u{1F7E1} \u5176\u4ED6\u53EF\u80FD\u4F1A\u5F71\u54CD\u9879\u76EE\u7684\u914D\u7F6E\u6587\u4EF6\u8DEF\u5F84\uFF0C\u5176\u5185\u5BB9\u53D8\u66F4\u4F1A\u4F7F\u7F13\u5B58\u5931\u6548
        },
      });
    }
  },
});

function createEnvironmentHash(env: Record<string, any>) {
  const hash = createHash('md5');
  hash.update(JSON.stringify(env));
  const result = hash.digest('hex');
  return result;
}
