`,paraId:2,tocIndex:1},{value:"Add ",paraId:3,tocIndex:1},{value:"extraBabelPlugins",paraId:3,tocIndex:1},{value:" to the configuration, but only enable it for production",paraId:3,tocIndex:1},{value:`// .umirc.ts
