import { RuntimeAntdConfig } from 'umi';
import { theme } from 'antd';

export const antd: RuntimeAntdConfig = (memo) => {
  memo.theme ??= {};
  memo.theme.algorithm = theme.darkAlgorithm; // \u914D\u7F6E antd5 \u7684\u9884\u8BBE dark \u7B97\u6CD5

  memo.appConfig = {
    message: {
      // \u914D\u7F6E message \u6700\u5927\u663E\u793A\u6570\uFF0C\u8D85\u8FC7\u9650\u5236\u65F6\uFF0C\u6700\u65E9\u7684\u6D88\u606F\u4F1A\u88AB\u81EA\u52A8\u5173\u95ED
      maxCount: 3,
    }
  }

  return memo;
};
